(function(){ /*создание листа подписания, обновление статуса участников для повторных */
  var document = stm_document;
  var isRepeated = stm_document.properties["lecm-events:is-repeated"];
  if(!routesService.hasEmployeesInRoute(document)){
  						var approvals = events.getEventMembers(document.nodeRef.toString());
						if (approvals && approvals.length>0) {
							var iteration = routesService.createEmptyIteration(document);
							iteration.properties['lecmWorkflowRoutes:routeInterruptAfterReject']=false;
							iteration.properties['lecmWorkflowRoutes:routeNotifyAboutEveryDecision']=true;
							iteration.save();
							var stage = routesService.createNewTemporaryNode(iteration.getNodeRef(),"lecmWorkflowRoutes:stage");
							stage.properties['lecmWorkflowRoutes:stageWorkflowType'] = "PARALLEL";
							stage.properties['lecmWorkflowRoutes:stageWorkflowTerm'] = 2;
							var today = new Date();
							var day = today.getDate();
                            day = day<10?("0"+day):(""+day);																	
							var month = today.getMonth()+1;
							stage.properties['cm:title'] = "Согласование повестки от "+day+"."+(month>9?month:("0"+month))+"."+today.getFullYear();
							stage.save();
							stage.removeAspect('sys:temporary');
							for (i = 0, size = approvals.length; i < size; ++i) {
								if (isRepeated==true) {
								  var row = events.getEmployeeEventMemberRow(stm_document.nodeRef.toString(), approvals[i].nodeRef.toString());
								  row.properties["lecm-events-ts:members-status"]="CONFIRMED";
								  row.save();
								}
								var stageItem = routesService.createNewTemporaryNode(stage.getNodeRef(),"lecmWorkflowRoutes:stageItem");
								stageItem.save();
								stageItem.createAssociation(approvals[i],  'lecmWorkflowRoutes:stageItemEmployeeAssoc');
								stageItem.removeAspect('sys:temporary');
							}
                        }
  }


})();

var document = bpm_package.children[0];
if (document != null) {
  var chairmanAssoc = document.assocs["lecm-meetings:chairman-assoc"];
  if (chairmanAssoc != null && chairmanAssoc.length == 1) {
    documentMembers.addMemberWithoutCheckPermission(document, chairmanAssoc[0], "LECM_BASIC_PG_Reader");
  }

  var secretaryAssoc = document.assocs["lecm-meetings:secretary-assoc"];
  if (secretaryAssoc != null && secretaryAssoc.length == 1) {
    documentMembers.addMemberWithoutCheckPermission(document, secretaryAssoc[0], "LECM_BASIC_PG_Reader");
  }
}

(function(){
  var meeting = stm_document;
  meeting.properties["lecm-events:show-in-calendar"]=true;
  meeting.properties["lecm-events:send-notifications"]=true;
  meeting.save();
  var tableAssocs = meeting.assocs["lecm-meetings-ts:items-assoc"];
  if (tableAssocs!==null && tableAssocs.length > 0){
    var table = tableAssocs[0];
    var  itemAssocs = table.childAssocs["cm:contains"];
    if (itemAssocs!==null && itemAssocs.length > 0 ){
      /* Проверяем документы */
      for (var i=0; i<itemAssocs.length ;i++ ) {
		var item = itemAssocs[i];
        var documents = item.assocs["lecm-meetings-ts:documents-assoc"];
        if (documents!==null && documents.length>0) {
		for (var j=0; j<documents.length ;j++ ) {
			var document = documents[i];
			documentConnection.createConnection(meeting, document, 'forInformation', true );
		}
        }
      }
    }
  }
  /*Notify members*/
  var members=events.getEventMembers(meeting);
  var text = "{lecm-events:initiator-assoc/lecm-orgstr:employee-short-name} приглашает на мероприятие {!lecm-document:present-string}. Начало: {lecm-events:from-date?dd.MM.yyyy}, в {lecm-events:from-date?HH:mm}";
  notifications.sendNotification(members, text, meeting);
  /*Notify responsible for resources*/
  var resources = events.getEventResources(meeting);
  if (resources !== null && resources.length>0) {
    for (var k=0; k<resources.length ;k++ ) {
      var responsible = events.getResourceResponsible(resources[k]);
      if (responsible!==null) {
		text = "Запланированное мероприятие {!lecm-document:present-string} требует привлечения ресурсов за которые вы ответственны.  Начало: {lecm-events:from-date?dd.MM.yyyy}, в {lecm-events:from-date?HH:mm}";
		notifications.sendNotification(members, text, meeting);
      }
    }
  }

  events.notifyInvitedMembers(stm_document, true);
  /*create repeated*/
  meetings.createRepetedMeetings(stm_document);
}());
